export const imp = () => {
    return  {
        type: 'IMP',
        payload: (status) => {
            let state = !status;
            if(state) {
                return 'important'; 
            } else {
                return;
            }
        }
    }
}

export const inc = () => ({type: 'INC'});

export const dec = () => ({type: 'DEC'});
